import React from 'react';

class Grid extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="ui segment">
                <div className="ui items">
                    <div className="item">
                        <div className="imgae">
                            <img src="https://www.teachingenglish.org.uk/sites/teacheng/files/styles/large/public/images/RS6954_146868800-hig%20%281%29.jpg?itok=zYhyzsrH" />
                        </div>
                        <div className="content">
                            <a className="header">Temperature {this.props.Temp}</a>
                            <div className="meta">
                                <span>Description</span>
                            </div>
                            <div className="description">
                                <p></p>
                            </div>
                            <div className="extra">
                                Additional Details
                        </div>
                        </div>
                    </div>
                </div>
            </div>

        );
    }
}

export default Grid;
